She doesn't make it on my feed very often, but Ugly is a 6 year old Shih Tzu who was a rescue from a women who did not care for her, and was leaving the country. Her name was Prada when she arrived, but my girl's sister, who wasn't too fond of Prada, took to calling her 'ugly', which quickly grew into a term of endearment as they grew attached. Prada was an ungroomed mess when she arrived, and my girl says she was so ugly that she was cute, and a few years later the name is still solid, and she's a very permanent, happy member of the family. .
